import React,{Component} from "react";
import {useState,useEffect} from 'react'
import Axios from 'axios'
import Home from "./pages/Home";
import Insert from './pages/insertData'
import{BrowserRouter as Router,Route,Routes,Link} from "react-router-dom"
import Error from './pages/Error'
import './app.css'
import Post from './pages/createpost';


function App(){


        return(
            <div>
                <Router>
                  <nav className="nav">
                    <Link id='link' className='navlink' to='/insertData'>Comment</Link>
                    <Link className='navlink' to='/'>Home</Link>
                  </nav>
                 <Routes>
                        <Route exact path="/" element={<Home/>}/>
                            <Route exact path="/insertData" element={<Insert/>}/>
                            <Route exact path="/Data/:id" element={<Post/>}/>
                            <Route exact path="*" element={<Error/>}/>
                        </Routes>               
                </Router>
            </div>
        )

}


// export default App;
export default App;
